import React from 'react'
import './Header.css';

const Header = () => {

    const darkTheme = createTheme({
        palette: {
            primary: {
                main: '#fff'
            },
          mode: 'dark',
        },
      });

    return (
        <div className='header'> 
            <span className='title'>Word Hunt</span>
            <div className='inputs'>
               Hello
                
            </div>
        </div>
    )
}

export default Header
